import React from 'react';
import { FaEdit, FaTrash } from 'react-icons/fa';
import './Rules.css';

function Rules() {
  return (
    <div className="rules-container">
      <button className="add-new-button">+ Add New</button>
      <table className="content-table">
        <thead>
          <tr>
            <th>Sr. No.</th>
            <th>Title</th>
            <th>Media Type</th>
            <th>Description</th>
            <th>Application Program</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {[...Array(10)].map((_, index) => (
            <tr key={index}>
              <td>{index + 1}</td>
              <td>IAP Disclaimer Check</td>
              <td>Docx</td>
              <td>Investor awareness programme content document</td>
              <td>IAF_Passive</td>
              <td>
                <button className="edit-button"><FaEdit /></button>
                <button className="delete-button"><FaTrash /></button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Rules;
